import React from "react";
import '../Styles/Footer.css'

export default function Footer() {
    return (
        <footer>
            <address>Created by <a href="https://github.com/FooLeeSze/fcc-portfolio" target="_blank" rel="noreferrer">Lee Sze Foo</a></address>
        </footer>
    )
}
